import React from 'react'
import './App.css'
import Navbar from './components/Navbar/Navbar'
import Landing from './components/landing/Landing'
import { useState, useEffect } from "react";
import axios from "axios";
import { API_KEY } from "./constants/Constants";
import { Rowpost } from './components/Rowpost';


function App() {
  const [trendingMovies, setTrendingMoviesData] = useState();
  const [netflixOriginals, setNetflixOriginals] = useState([]);
  console.log(trendingMovies)

  useEffect(() => {
    axios
      .get(`https://api.themoviedb.org/3/trending/all/day?api_key=${API_KEY}`)
      .then((res) => {
        setTrendingMoviesData(res.data);
      });

    axios
      .get(`https://api.themoviedb.org/3/discover/tv?api_key=${API_KEY}`)
      .then((res) => {
        setNetflixOriginals(res.data.results);
      });
  }, []);

	return (
    <div>
      <Navbar />
      <Landing />
      <Rowpost
        title="Netflix Originals"
        movies={netflixOriginals ? netflixOriginals : ""}
      />
      <Rowpost
        title="Trending Movies"
        trending={trendingMovies ? trendingMovies : ""}
      />
    </div>
  );
}

export default App
